description:
Aftermath (NEW 2014 Wicked Pictures) [DVDRip]

Asa Akira, Aubrey Addams, Bonnie Rotten, Brandi Love, Chloe Amour, jessica drake, Kaylani Lei, Sarah Jessie, Vicki Chase

Brad Armstrong, creator of the epic love story FALLEN and the runaway 2014 blockbuster UNDERWORLD, now delivers his follow-up masterpiece AFTERMATH, a twisted tale of forbidden love. Leading man Ryan Driller and XBIZ / XRCO Best Male Newcomer Tyler Nixon, three-time AVN Best Actress Winner jessica drake is the woman who loves them. Wicked Sensation &amp; Performer of the year Asa Akira, Performer of the Year Bonnie Rotten, MILF superstar Brandi Love and Best Actor Winner Xander Corvus round out an amazing cast. An intensely powerful coming-of-age drama that explores and shatters sexual boundaries, AFTERMATH is destined to become an instant classic.

